import React from "react";

function Blog(props) {
  return (
   <a className="card" href="#">
    <div className="card__background" style={{backgroundImage:props.img}}></div>
    <div className="card__content">
      <p className="card__category">{props.title}</p>
    </div>
   </a>
  );
}

export default Blog;
